import React from 'react';
import "./Notifications.css"

const Notifications = () => {
    return(
        <div className='Notifications'>
        <button 
        aria-label="Close"
        style={{ float: "right", position: "absolute", top: 0, right: 0, padding: "10px", backgroundColor: "transparent", border: "none", cursor: "pointer", color: "#00aecd", stroke: "#00aecd", fill: "#00aecd", strokeWidth: 1.25 }}
        >
        </button>
            <p>Here is the list of notifications</p>
        </div>
    )
}

export default Notifications
